import React from 'react';
import Navbar from './Navbar';

function Settings() {
	return (
		<div className='settings-container'>
			<div className='row'>
				<div id='nav-section' className='col-2'>
					<Navbar />
				</div>
				<div className='col-10'>
					<h1 className='dash-heading'>Settings</h1>
					<hr className='dash-line' />
					<div className='take-inventory'>
						<h4>How will BarFile work for you?</h4>
						<form>
							<label htmlFor='threshold'>
								What distributers do you use to stock your bar?
								List them separated by commas.
							</label>
							<input type='textbox' name='threshold' />
						</form>
					</div>
				</div>
			</div>
		</div>
	);
}

export default Settings;
